9,33,1526,0,'loglevel',0,'Basic'),(32580,33,1526,0,'insertScript',0,'N'),(32581,33,1526,0,'script',0,'#!/bin/bash\r\n \r\n\r\r\n# this script allows to delete data on one day into dtm tables\r\r\n\r\r\n\r\r\n\r\n\r\nif [ \"$1\" == \"\" ] || [ \"$2\" == \"\" ]; then\r\n    \r\r\necho \"Usage : delete_ods_day.sh YYYY_MM_DD YYYY_MM_DD\"\r\n\r\r\nelse\r\n    echo \"I delete dtm table between $1 and $2\"\r\r\n\r\nfi\r\n\r\n\r\r\n\r\r\nuser=vanillabmrt\r\r\n\r\npassword=SaintThomas,2014\r\r\n\r\ndatabase=vaneon_ods\r\r\n\r\r\n\r\n\r\necho \"DELETE from logs_solarwind WHERE date_format(concat(concat(concat(concat(substr(replace(left(time,10),\'/\',\'-\'),7,4),\'-\'),substr(replace(left(time,10),\'/\',\'-\'),4,2)),\'-\'),substr(replace(left(time,10),\'/\',\'-\'),1,2)),\'%Y-%m-%d\') between DATE_FORMAT(REPLACE(\'$1\',\'_\',\'-\'),\'%Y-%m-%d\') and DATE_FORMAT(REPLACE( \'$2\',\'_\',\'-\'),\'%Y-%m-%d\');\" |  mysql --user=\"$user\" --password=\"$password\" --database=\"$database\"\r\n\r\r\necho \"DELETE FROM logs_solarwind executed\"\r\n\r\necho \"DELETE FROM logs WHERE date_format(from_unixtime(time),\'%Y-%m-%d\') between DATE_FORMAT(REPLACE(\'$1\',\'_\',\'-\'),\'%Y-%m-%d\') and DATE_FORMAT(REPLACE( \'$2\',\'_\',\'-\'),\'%Y-%m-%d\');\" |  mysql --user=\"$user\" --password=\"$password\" --database=\"$database\"\r\necho \"DELETE FROM logs executed\"\r\n'),(32582,33,1526,0,'argument',0,'${extractbeg}'),(32583,33,1526,1,'argument',0,'${extractend}'),(32699,25,1534,0,'start',0,'Y'),(32700,25,1534,0,'dummy',0,'N'),(32701,25,1534,0,'repeat',0,'N'),(32702,25,1534,0,'schedulerType',0,NULL),(32703,25,1534,0,'intervalSeconds',0,NULL),(32704,25,1534,0,'intervalMinutes',60,NULL),(32705,25,1534,0,'hour',12,NULL),(32706,25,1534,0,'minutes',0,NULL),(32707,25,1534,0,'weekDay',1,NULL),(32708,25,1534,0,'dayOfMonth',1,NULL),(32709,25,1535,0,'specification_method',0,'rep_ref'),(32710,25,1535,0,'trans_object_id',0,'99'),(32711,25,1535,0,'name',0,NULL),(32712,25,1535,0,'dir_path',0,NULL),(32713,25,