D(time_to_sec(FROM_UNIXTIME(logs.time))/60)/10)*10 - \r\n   ROUND(time_to_sec(FROM_UNIXTIME(logs.time))/60) > 0 \r\n   THEN ROUND(ROUND(time_to_sec(FROM_UNIXTIME(logs.time))/60)/10)*10 - 5\r\n   ELSE ROUND(ROUND(time_to_sec(FROM_UNIXTIME(logs.time))/60)/10)*10 END\r\nend as code_interval_final,\r\nhost.host_name,\r\nCASE WHEN services.service_name is null THEN \'Hoststatus\' \r\nELSE services.service_name END as service_name,\r\nCASE WHEN services.service_name is null THEN \'all\' \r\nELSE logs.source_id END as source_service,\r\nSUBSTRING_INDEX(messages.message,\';\',1) as message_type,\r\n FROM_UNIXTIME(logs.time) as datetime_2,\r\nchargement.chg_id,\r\nd_service.DSE_ID\r\nFROM logs \r\n	inner join host on host.host_id = logs.host_id and host.source_id = logs.source_id\r\n	left join services on logs.service_id = services.services_id and services.source_id = logs.source_id and host.host_id = services.host_id\r\n	inner join messages on logs.message = messages.message_id and logs.source_id = messages.source_id\r\n	left join (SELECT DISTINCT DSE_ID, DSE_NAME, DSE_CHG_ID, DSE_SOURCE\r\n			   FROM eor_dwh.d_service \r\n			   UNION ( SELECT 0 as DSE_ID, \'Hoststatus\' DSE_NAME ,\'2014-01-01\' as DSE_CHG_ID, \'all\' as DSE_SOURCE \r\n			   FROM DUAL)) d_service \r\n		on d_service.dse_name = (CASE WHEN services.service_name is null THEN \'Hoststatus\' ELSE services.service_name END)\r\n		   and \r\n		   DSE_SOURCE = (CASE WHEN services.service_name is null THEN \'all\' ELSE logs.source_id END), \r\n	(SELECT case when max(chg_id) is null then 1 else max(chg_id) + 1 end as chg_id,\r\n	 date_format(curdate(),\'%Y-%m-%d\') as extract_date\r\n 	from eor_dwh.d_chargement) chargement\r\nWHERE down_flag <> \'DOWN\' and DATE_FORMAT(FROM_UNIXTIME(logs.time),\'%Y-%m-%d\')  between \'${extract_beg}\' and \'${extract_end}\''),(6681,35,273,0,'limit',0,'0'),(6682,35,273,0,'lookup',0,NULL),(6683,35,273,0,'execute_each_row',0,'N'),(6684,35,273,0,'variables_active',0,'Y'),(6685,35,273,0,'la