or_dwh.d_host.DHO_ID,\r\nd_service.DSE_ID,\r\neor_dwh.d_message_type.met_id,\r\nCASE WHEN d_service.dse_name = \'Hoststatus\' and (logs.state = 1 or logs.state= 2) then 0\r\nWHEN  d_service.dse_name <> \'Hoststatus\' and (logs.state = 2 or logs.state= 3) then 0\r\nelse 1 END as state_unif\r\nFROM logs \r\n	inner join host on host.host_id = logs.host_id and host.source_id = logs.source_id\r\n	left join services on logs.service_id = services.services_id and services.source_id = logs.source_id and host.host_id = services.host_id\r\n	inner join messages on logs.message = messages.message_id and logs.source_id = messages.source_id\r\n	left join eor_dwh.d_host on d_host.dho_name = host_name and d_host.dho_source = logs.source_id\r\n	left join eor_dwh.d_message_type on d_message_type.met_type_label = SUBSTRING_INDEX(messages.message,\';\',1)\r\n	left join eor_dwh.d_service \r\n		on d_service.dse_name = (CASE WHEN services.service_name is null THEN \'Hoststatus\' ELSE services.service_name END)\r\n		   and DSE_SOURCE = logs.source_id, \r\n	(SELECT case when max(chg_id) is null then 1 else max(chg_id) + 1 end as chg_id,\r\n	 date_format(curdate(),\'%Y-%m-%d\') as extract_date\r\n 	from eor_dwh.d_chargement) chargement\r\nWHERE down_flag = 0 and logs.time between \'${extractbeg}\' and \'${extractend}\''),(54354,36,1873,0,'limit',0,'0'),(54355,36,1873,0,'lookup',0,NULL),(54356,36,1873,0,'execute_each_row',0,'N'),(54357,36,1873,0,'variables_active',0,'Y'),(54358,36,1873,0,'lazy_conversion_active',0,'N'),(54359,36,1873,0,'cluster_schema',0,NULL),(54360,36,1873,0,'row_distribution_code',0,NULL),(54361,36,1874,0,'PARTITIONING_SCHEMA',0,NULL),(54362,36,1874,0,'PARTITIONING_METHOD',0,'none'),(54363,36,1874,0,'id_connection',9,NULL),(54364,36,1874,0,'schema',0,NULL),(54365,36,1874,0,'table',0,'f_dwh_logs_nagios'),(54366,36,1874,0,'commit',0,'20000'),(54367,36,1874,0,'truncate',0,'N'),(54368,36,1874,0,'ignore_errors',0,'N'),(54369,36,1874,0,'use_batch',0,'Y'),(54370,36,1874,0,'specify