service.service_name,\r\nchargement.chg_id, \'${v_source_name_lilac}\' as bp_source, \'${v_source_name_lilac}\' as host_service_source\r\nFROM \r\n	(SELECT distinct hostgroup.name as hostgroup_name, host.name as host_name, host.id as host_id\r\n    FROM ${v_lilac_database}.nagios_hostgroup hostgroup\r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup_membership hs_member on hs_member.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host host on host.id = hs_member.host\r\n\r\n	UNION\r\n\r\n	(SELECT distinct hostgroup.name as hostgroup_name, host.name as host_name, host.id as host_id \r\n    FROM ${v_lilac_database}.nagios_hostgroup hostgroup\r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup_membership hs_member on hs_member.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host_template host_template on host_template.id = hs_member.host_template\r\n	INNER JOIN ${v_lilac_database}.nagios_host_template_inheritance ht_inheritance on ht_inheritance.target_template = host_template.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host host on host.id = ht_inheritance.source_host)\r\n	) hostgroup_host\r\n\r\nINNER JOIN\r\n\r\n	(SELECT host.name as host_name, service.description as service_name, host.id as host_id\r\n	 FROM ${v_lilac_database}.nagios_service service \r\n	INNER JOIN ${v_lilac_database}.nagios_host host on service.host  = host.id\r\n\r\n	UNION\r\n\r\n	(SELECT distinct host.name as host_name, service.description as service_name, host.id as host_id\r\n	FROM ${v_lilac_database}.nagios_service service \r\n	INNER JOIN ${v_lilac_database}.nagios_host_template host_template on host_template.id = service.host_template\r\n	INNER JOIN ${v_lilac_database}.nagios_host_template_inheritance ht_inheritance on ht_inheritance.target_template = host_template.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host host on host.id = ht_inheritance.source_host)\r\n\r\n	UNION\r\n\r\n	(SELECT distinct host.name as host_name, service.description as service_name, host.id as host_id FROM\r\n	${v_lilac_database}.nagios_service service \r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup hostgroup on service.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup_membership hs_member on hs_member.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host host on host.id = hs_member.host)\r\n\r\n	UNION\r\n\r\n	(SELECT distinct host.name as host_name, service.description as service_name, host.id as host_id FROM\r\n	${v_lilac_database}.nagios_service service \r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup hostgroup on service.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup_membership hs_member on hs_member.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host_template host_template on host_template.id = hs_member.host_template\r\n	INNER JOIN ${v_lilac_database}.nagios_host_template_inheritance ht_inheritance on ht_inheritance.target_template = host_template.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host host on host.id = ht_inheritance.source_host)\r\n	) host_service\r\nON host_service.host_id = hostgroup_host.host_id,\r\n(SELECT case when max(chg_id) is null then 1 else max(chg_id) + 1 end as chg_id from eor_ods.chargements) chargement\r\n\r\nUNION\r\n(\r\nSELECT distinct concat(\'hostgroup_ws_\',hostgroup_host.hostgroup_name) as hostgroup_name, hostgroup_host.host_name, hostgroup_host.service_name,\r\nchargement.chg_id, \'${v_source_name_lilac}\' as bp_source, \'${v_source_name_lilac}\' as host_service_source\r\nFROM \r\n	(SELECT distinct hostgroup.name as hostgroup_name, host.name as host_name, host.id as host_id, \'Hoststatus\' as service_name\r\n    FROM ${v_lilac_database}.nagios_hostgroup hostgroup\r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup_membership hs_member on hs_member.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host host on host.id = hs_member.host\r\n\r\n	UNION\r\n\r\n	(SELECT distinct hostgroup.name as hostgroup_name, host.name as host_name, host.id as host_id, \'Hoststatus\' as service_name\r\n    FROM ${v_lilac_database}.nagios_hostgroup hostgroup\r\n	INNER JOIN ${v_lilac_database}.nagios_hostgroup_membership hs_member on hs_member.hostgroup = hostgroup.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host_template host_template on host_template.id = hs_member.host_template\r\n	INNER JOIN ${v_lilac_database}.nagios_host_template_inheritance ht_inheritance on ht_inheritance.target_template = host_template.id\r\n	INNER JOIN ${v_lilac_database}.nagios_host host on host.id = ht_inheritance.source_host)\r\n	) hostgroup_host,\r\n(SELECT case when max(chg_id) is null then 1 else max(chg_id) + 1 end as chg_id from eor_ods.chargements) chargement\r\n)'),(73827,113,2641,0,'limit',0,'0'),(73828,113,2641,0,'lookup',0,NULL),(73829,113,2641,0,'execute_each_row',0,'N'),(73830,113,2641,0,'variables_active',0,'Y'),(73831,113,2641,0,'lazy_conversion_active',0,'N'),(73832,113,2641,0,'cluster_schema',0,NULL),(73833,113,2641,0,'row_distribution_code',0,NULL),(73834,113,2642,0,'PARTITIONING_SCHEMA',0,NULL),(73835,113,2642,0,'PARTITIONING_METHOD',0,'none'),(73836,113,2642,0,'id_connection',2,NULL),(73837,113,2642,0,'sql',0,'SELECT case when max(chg_id) is null then 1 else max(chg_id) + 1 end as chg_id,\r\ndate_format(curdate(),\'%Y-%m-%d\') as extract_date, \r\n\'ETL_ODS_HGWS_BP_SERVICE_NAG_GROUPBP\' as etl_name, \'${v_source_name_lilac}\' as source\r\n from eor_ods.chargements'),(73838,113,2642,0,'limit',0,'0'),(73839,113,2642,0,'lookup',0,NULL),(73840,113,2642,0,'execute_each_row',0,'N'),(73841,113,2642,0,'variables_active',0,'Y'),(73842,113,2642,0,'lazy_conversion_active',0,'N'),(73843,113,2642,0,'cluster_schema',0,NULL),(73844,113,2642,0,'row_distribution_code',0,NULL),(73845,113,2643,0,'PARTITIONING_SCHEMA',0,NULL),(73846,113,2643,0,'PARTITIONING_METHOD',0,'none'),(73847,113,2643,0,'id_connection',2,NULL),(73848,113,2643,0,'schema',0,NULL),(73849,113,2643,0,'table',0,'ch