 app_leaf, g.hsa_host as host_id, g.hsa_service as service_id  from (\r\n	SELECT master, dhc_id, child from (\r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl2_id as child, 1 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl3_id as child, 2 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl4_id as child, 3 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl5_id as child, 4 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl6_id as child, 5 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl7_id as child, 6 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl8_id as child, 7 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl9_id as child, 8 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl10_id as child, 9 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl11_id as child, 10 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl12_id as child, 11 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl13_id as child, 12 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl14_id as child, 13 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl15_id as child, 14 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl16_id as child, 15 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl17_id as child, 16 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id master, dhc_lvl18_id as child, 17 as level FROM d_hierarchy_column)\r\nUNION \r\n	(SELECT dhc_id, dhc_lvl1_id maste